import React, {Component} from "react";
import {Button, Col, Container, Form} from "react-bootstrap";
import SidebarBusiness from "../../Layout/Sidebar/SidebarBusiness.js";
import * as IoIcons from 'react-icons/io';




class AddEmployee extends Component
{
    constructor(props) {
        super(props)

        this.state = {
            id: '',
            name: '',
            workingHours:'',
            businessName:'',
        }
       
    }
    
        render(){
               return (
            <>
             <SidebarBusiness/>
              <div style={{ marginLeft: '25%' }}>
                <h1><IoIcons.IoMdPeople /> add Employee</h1>
                 <div >
                    <form onSubmit={this.handleSubmit}>
                        <div className="form-group">
                            <label> Employee name: </label>
                            <input type="text" placeholder="Name" name="name" className="form-control"
                                // value={this.state.username} onChange={this.changeNameHandler}
                             />
                             <label>Business Name: </label>
                            <input type="text" placeholder="Business Name" name="busName" className="form-control"
                                // value={this.state.username} onChange={this.changeNameHandler}
                            />
                             <label>Job: </label>
                            <input type="text" placeholder="job Name" name="job" className="form-control"
                                // value={this.state.username} onChange={this.changeNameHandler}
                            />
                             <label>Working Hours: </label>
                            <input type="text" placeholder="Name" name="name" className="form-control"
                                // value={this.state.username} onChange={this.changeNameHandler}
                            />
                            
                        </div>
                        
                        <Button
                            className="btn btn-success"
                            // onClick={this.SaveData.bind(this, this.state.id)}
                             href="/profile"
                             >
                            Save
                        </Button>
                    </form>
                </div>
            </div>
            </>
                 
               );
               
           }
}

         
      export default AddEmployee;
